pragma solidity ^0.8.8;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";



contract FundMe{

    uint256 public minimumFund = 50;

    // constructor() payable{
    //     val = msg.value;
    // }

    function Fund() public payable{
        require(msg.value >= minimumFund, "Didn't send enough");
    }

